ahhh perfect  that tracks. In Empirica, `roundIndex` was your own custom field (only set if you explicitly `round.set(roundIndex, i)`), whereas **`index` is a built-in** on rounds/stages:

- `stage.currentRound.index`  the rounds 0-based position in `game.rounds`
- `stage.index`  the stages 0-based position within its round

So switching to `index` works because its always populated by the framework, while `roundIndex` wasnt guaranteed to exist.

